import React from 'react';
import './Header.css';
import toyota from '../../assets/toyota.svg';

function Header(){
    return(
        <div className='header-wrapper'>
            <div className='header-logo'>
                <img src={toyota} alt=''></img>
            </div>
        </div>
    );
};

export default Header;
